Bienice () is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Dobra%2C%20%C5%81obez%20County"&gt;Gmina Dobra&lt;/a&gt;, within &lt;a href="%C5%81obez%20County"&gt;Łobez County&lt;/a&gt;, &lt;a href="West%20Pomeranian%20Voivodeship"&gt;West Pomeranian Voivodeship&lt;/a&gt;, in north-western Poland. It lies approximately north of &lt;a href="Dobra%2C%20%C5%81obez%20County"&gt;Dobra&lt;/a&gt;, west of &lt;a href="%C5%81obez"&gt;Łobez&lt;/a&gt;, and north-east of the regional capital &lt;a href="Szczecin"&gt;Szczecin&lt;/a&gt;.
